import React from 'react'
import {Link} from 'react-router-dom'

function Navbars() {
  return (
   <nav>
    <Link to="">HOME</Link>
    <Link to="">ABOUT</Link>
    <Link to="">LOG OUT</Link>
    <Link to="/cart">CART</Link>
   </nav>
  )
}

export default Navbars
